INSERT INTO SYSTEM_VARIABLES VALUES("INNODB_CHECKSUM_ALGORITHM","","INNODB","COMPILE-TIME","INNODB","GLOBAL","ENUM","The algorithm InnoDB uses for page checksumming. Possible values are CRC32 (hardware accelerated if the CPU supports it) write crc32, allow any of the other checksums to match when reading; STRICT_CRC32 write crc32, do not allow other algorithms to match when reading; INNODB write a software calculated checksum, allow any other checksums to match when reading; STRICT_INNODB write a software calculated checksum, do not allow other algorithms to match when reading; NONE write a constant magic number, do not do any checksum verification when reading (same as innodb_checksums=OFF); STRICT_NONE write a constant magic number, do not allow values other than that magic number when reading; Files updated when this option is set to crc32 or strict_crc32 will not be readable by MySQL versions older than 5.6.3","","","","CRC32,STRICT_CRC32,INNODB,STRICT_INNODB,NONE,STRICT_NONE","NO","REQUIRED");
